import React from 'react';
class ApplyForm extends React.Component() {
    constructor(props) {
        super(props);
        this.state = {

        }
        this.handleInputChanges = this.handleInputChanges.bind(this);
    }

    handleInputChanges(event) {

        var changedValue = event.target.value;

        if(event.target.className === "name") {
            this.setState({
                name: changedValue
            });
        } else if (event.target.className === "roll") {
            this.setState({
                roll: changedValue
            });

        } else {
            this.setState({
                address: changedValue
            });
        }

    }
    render(){
    return (
        <div>
            <div style={{ backgroundColor: "Yellow" }}><h3><b><center>Registration Form</center></b></h3></div>
            <form>
                <label><b>Name&nbsp;</b></label>
                <input type="text" className="name" onChange={this.handleInputChanges} value={this.state.name} /><br /><br />
                <label><b>Roll No.&nbsp;</b></label>
                <input type="text" className="roll" onChange={this.handleInputChanges} value={this.state.roll}/><br /><br />
                <label><b>Course&nbsp;</b></label>
                <select name="course" className="course">
                    <option value="">B.Tech</option>
                    <option value="">M.Tech</option>
                    <option value="">BCA</option>
                    <option value="">MCA</option>
                    <option value="">MBA</option>
                </select><br /><br />
                <label><b>College&nbsp;</b></label>
                <select name="college" className="college">
                    <option value="">B.Galgotia University</option>
                    <option value="">G.L Bajaj College of Engineering</option>
                    <option value="">GNIOT Group of Institution</option>
                    <option value="">IIMS College</option>
                    <option value="">Sharda University</option>
                </select><br /><br />
                <label><b>Branch</b><br />
                    <div className="radio">
                        <label>
                            <input type="radio" value="" checked={true} />
                            CSc.
                        </label>
                        <label>
                            <input type="radio" value="" />
                            EC
                        </label>
                        <label>
                            <input type="radio" value="" />
                            IT
                        </label>
                        <label>
                            <input type="radio" value="" />
                            Civil
                        </label>
                        <label>
                            <input type="radio" value="" />
                            EE
                        </label>
                    </div>
                </label><br />
                <label><b>Address</b><br/>
                <textarea value = {this.state.address} className="address" onChange={this.handleInputChanges}/>
                </label><br/><br/>
                <input type="button" name = "submit" value="Submit"/>
            </form>
        </div>
    );
    }
}


export default ApplyForm;
